import React from "react";
import { FaServicestack } from "react-icons/fa";
import "./style/difference.css";

function Difference() {
  const differenceData = [
    {
      id: 1,
      core: "proffesionalism",
      text: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Temporibus repellat veniam ipsam quas modi impedit illum veritatis, tenetur, ullam iste incidunt laboriosam fuga ea fugiat  iure. Sunt maxime maiores repudiandae.",
    },
  ];

  return (
    <div className="difference">
      <div className="differenceHeader">
        <h3>What Makes US different</h3>
      </div>
      <div className="d-contextContainer" key={id}>
        {differenceData.map((item) => {
          const { id, core, text } = item;
          return (
            <div className="d-cardWrapper">
              <div className="d-context">
                <div className="d-icon">
                  <FaServicestack className="icon" />
                </div>
                <div className="advantage">{core}</div>
                <div className="d-pTag">{text}</div>
              </div>
            </div>
          );
        })}{" "}
      </div>
    </div>
  );
}

export default Difference;
